import './App.css';
import React, { useEffect, useState } from 'react';
import axios from 'axios';

const getEmployeeList = (employees) => {
  const employeeList = employees.data.map(employee =>
    <ul> 
      <h3>Employee Listing</h3>
      <li>
        <span className="employee-id">{employee.id}.</span> <span className="employee-name">{employee.name}</span> 
      </li>
      <li>
        {employee.bio}
      </li>
    </ul>
  )
  return employeeList
}

function App() {
  const [employees, setEmployees] = useState({ })

  useEffect(() => {
    axios.get('http://localhost:5000/employees').then(response => {
      setEmployees(response)
    }).catch(error => {
      console.log(error)
    })
  }, [])
  return (
    <div className="App">

      <div>
        {employees.status === 200 ?
          <h3>{getEmployeeList(employees)}</h3>
          :
          <h3>LOADING</h3>
        }
      </div>
    </div>
  );
}

export default App;
